};

const VideoTable = ({ videos, handleVote, handleRemove }) => {
  // Your VideoTable component code here

  return (
    <div className="video-cards">
      {videos.map((video) => {
        const uploadDate = new Date(
          Date.now() - Math.floor(Math.random() * 30) * 24 * 60 * 60 * 1000
        );

        const videoUrl = video.url.startsWith('https://www.youtube.com/watch?v=')
          ? convertWatchToEmbedLink(video.url)
          : video.url;

        return (
          <div className="video" key={video.id}>
            <h2>{video.title}</h2>
            <div className="anything">
              <iframe src={videoUrl} title={video.title} allowFullScreen />
            </div>

            {/* Render Rating component */}
            <Rating video={video} handleVote={handleVote} handleRemove={handleRemove} />

            <p>Uploaded: {uploadDate.toLocaleString()}</p>
          </div>
        );
      })}
    </div>
  );
};

export default VideoTable;
